import React from 'react';
import './App.css';

function App() {
  return (
    <div>
      <div className="toolbar">toolbar</div>
      <div className="main-view">
        <div className="sidebar">sidebar</div>
        <div className="list">list</div>
      </div>
    </div>
  );
}

export default App;
